values:
So in a blink of an eye, it&#39;s the 31st of December already. 2012 had been amazing to me in many different ways. I have travelled a few times - taiwan, bkk(2) and korea, had pleasant relationship with most of whom are important to me, celebrated my 21st in the best possible way and I will end this year with a bang together with the people I care for!

Thank you to whoever who said that 2012 is the end of the world cause that made me cherish things around me a little more. ;) 2013 will bring on more challenges and things that I have set to do (i.e saving money cause I like to spend to my very last cents and I work only to pay off my travelling expenses and that needs to be changed). Also, I want to have a white christmas in 2013 do you hear that Eugene Hwee?&nbsp;

Additionally, I hope that my uni life would be smooth flowing and of course for myself to be a way more focused on my studies.&nbsp;

Till then.

xoxo, (pretty upset about the fact gossip girl had ended despite the downward&nbsp;spiralling content. I&#39;ve been a fan since 6 years ago!)&nbsp;
